import sanityClient from '@sanity/client';

export const client = sanityClient({
    projectId: "z1eknl1r",
    dataset: 'production',
    apiVersion: '2022-02-01',
    useCdn: true,
    token: process.env.REACT_APP_SANITY_TOKEN
});
